import {Routes,Route} from "react-router-dom";
import {Link,useParams} from"react-router-dom";
function Home(){
return (
    <>
    {}
    <Header/>
    <Routes>

    {}
    <Route path="/" element={<Tours data={data}/>}/>
    <Route path={`/city/${useParams()}`} element={<Tours_details/>}/>
    {}

    </Routes>
    <Footer/>
    </>
);
}
export default Home;
